import "./header.css";
//import './Online.css'

const Header = () => {
  return (
    <>
      <header className="header">
        <h1 className="color">React Meals</h1>
        <button>Cart</button>
      </header>
      <div className="main-image">
        <img
          src="https://images.unsplash.com/photo-1486328228599-85db4443971f?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1770&q=80"
          alt="cover food img"
        />
      </div>
    </>
  );
};

export default Header;
